pub enum RawEntryMut<'a, K: 'a, V: 'a, S: 'a> {
    Occupied(RawOccupiedEntryMut),
    Vacant(RawVacantEntryMut),
}

pub enum Entry<'a, K: 'a, V: 'a, S: 'a> {
    Occupied(OccupiedEntry),
    Vacant(VacantEntry),
}

pub enum CollectionAllocErr {
    CapacityOverflow,
    AllocErr {
        layout: alloc::alloc::Layout,
    },
}
